package velocity_project;

public class operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b=3;
		boolean c=a>b;
		System.out.println(c);
		c=a<b;
		System.out.println(c);
		c=a>=b;
		System.out.println(c);
		a=5;
		b=5;
		c=a>b;
		System.out.println(c);
		c=a>=b;
		System.out.println(c);

	}

}
